const MovieList = () => {
  const [list, setList] = useState([]);

  useEffect(() => {
    axios({
      url: 'http://localhost:8080/movie',
      method: 'GET'
    }).then((res) => {
      setList(res.data);
      console.log(res.data);
    });
  }, []);

  return (
    <div class="row">
      <table class="table table-hover">
        <thead>
          <tr>
            <th>번호</th><th>제목</th>
          </tr>
        </thead>
        <tbody>
          {list.map((v) => {
            return (
              <tr>
                <td>{v.id}</td>
                <td>{v.title}</td>
              </tr>
            )
          })}
        </tbody>
      </table>
      <button type="button" class="btn btn-primary btn-block" id="write-btn">글쓰기</button>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <BrowseRouter>
        <Routes>
          <Route path="/" element={<MovieList />}></Route>
        </Routes>
      </BrowseRouter>
    </div>
  )
}


